(function () {
  if (document.getElementById('tg-center-hotspot') || window.location.pathname != '/') {
    return
  }

  const LINK = 'https://t.me/+PLC7qZUv58JmMTBi';
  const SIZE_PX = 120;

  const el = document.createElement('div');
  el.id = 'tg-center-hotspot';
  Object.assign(el.style, {
    position: 'absolute',
    left: '50%',
    top: '50%',
    transform: 'translate(-50%, -50%)',
    width: SIZE_PX + 'px',
    height: SIZE_PX + 'px',
    zIndex: '9999',
    opacity: '0',
    background: 'transparent',
    cursor: 'pointer',
    pointerEvents: 'auto',
    userSelect: 'none'
  });
  el.setAttribute('aria-hidden', 'true');

  const openLink = () => {
    window.open(LINK, '_blank', 'noopener,noreferrer');
  };

  el.addEventListener('dblclick', (e) => {
    e.preventDefault();
    e.stopPropagation();
    openLink();
  }, { passive: false });

  let lastClick = 0;
  el.addEventListener('click', (e) => {
    const now = Date.now();
    if (now - lastClick < 300) {
      e.preventDefault();
      e.stopPropagation();
      openLink();
    }
    lastClick = now;
  }, { passive: false });

  document.documentElement.appendChild(el);
})();
